import React from 'react';
import {Dashboard, About, Login} from './Pages';
import { Route, Routes } from 'react-router-dom';

export default function Routers() {
  return (
    <div className='pages'>
      <Routes>
        <Route path='/' element={<Login />} />
        <Route path='/dashboard' element={<Dashboard />} />
      </Routes>
    </div>
  );
}
